oin Supply\" value=\"19,808,229\" is_positive_intent=\"false\" is_upward_change=\"false\"/\u003e\u003cBigNumber heading=\"Bitcoin Miner Revenue\" value=\"$45,485,218\" is_positive_intent=\"false\" is_upward_change=\"false\"/\u003e\u003cBigNumber heading=\"Bitcoin Transaction Volume\" value=\"$13,174,687,263\" is_positive_intent=\"false\" is_upward_change=\"false\"/\u003e\u003cBigNumber heading=\"Bitcoin Dominance\" value=\"54.35%\" is_positive_intent=\"false\" is_upward_change=\"false\"/\u003e\u003cBigNumber heading=\"Bitcoin Market Sentiment\" value=\"Neutral\" is_positive_intent=\"false\" is_upward_change=\"false\"/\u003e\u003cBigNumber heading=\"Bitcoin Valuation\" value=\"Fair Value\" is_positive_intent=\"false\" is_upward_change=\"false\"/\u003e\u003c/Group\u003e\u003cText\u003e\u003c![CDATA[### Bitcoin Weekly OHLC Price Chart]]\u003e\u003c/Text\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" responsive=\"true\" scale=\"1.0\" src=\"ref://b6ef1b2ac9\"/\u003e\u003cText\u003e\u003c![CDATA[# Performance Tables]]\u003e\u003c/Text\u003e\u003cText\u003e\u003c![CDATA[A comparative view of Bitcoin\u0027s performance against key Equity Indexes, Sector ETFs, Macro Assets, and Bitcoin Stocks \u0026 ETFs.]]\u003e\u003c/Text\u003e\u003cGroup columns=\"2\" valign=\"top\"\u003e\u003cGroup columns=\"1\" valign=\"top\"\u003e\u003cText\u003e\u003c![CDATA[### Equity Index Performance]]\u003e\u003c/Text\u003e\u003cTable type=\"application/vnd.datapane.table+html\" name=\"equity_performance_table\" src=\"ref://418ffd500c\"/\u003e\u003c/Group\u003e\u003cGroup columns=\"1\" valign=\"top\"\u003e\u003cText\u003e\u003c![CDATA[### Sector ETF Performance]]\u003e\u003c/Text\u003e\u003cTable type=\"application/vnd.datapane.table+html\" name=\"sector_performance_table\" src=\"ref://7460a6fe3b\"/\u003e\u003c/Group\u003e\u003cGroup columns=\"1\" valign=\"top\"\u003e\u003cText\u003e\u003c![CDATA[### Macro Asset Performance]]\u003e\u003c/Text\u003e\u003cTable type=\"application/vnd.datapane.table+html\" name=\"macro_performance_table\" src=\"ref://3e26acf76d\"/\u003e\u003c/Group\u003e\u003cGroup columns=\"1\" valign=\"top\"\u003e\u003cText\u003e\u003c![CDATA[### Bitcoin Stock \u0026 ETF Performance]]\u003e\u003c/Text\u003e\u003cTable type=\"application/vnd.datapane.table+html\" name=\"bitcoin_performance_table\" src=\"ref://d2a6880896\"/\u003e\u003c/Group\u003e\u003c/Group\u003e\u003cText\u003e\u003c![CDATA[### Monthly Bitcoin Price Performacne Heatmap]]\u003e\u003c/Text\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" responsive=\"true\" scale=\"1.0\" src=\"ref://353997bb34\"/\u003e\u003cText\u003e\u003c![CDATA[## Continue Your Bitcoin Journey With The Secret Satoshis Newsletter: \u003ca href=\u0027https://www.newsletter.secretsatoshis.com/\u0027 target=\u0027_blank\u0027\u003eSubscribe Now\u003c/a\u003e\n\nSubscribe to the Secret Satoshis Newsletter for exclusive, weekly Bitcoin market updates and data-driven analysis powered by Agent 21. Stay informed with concise insights that help you navigate the Bitcoin landscape with confidence.\n\nSubscribe Now to Stay Ahead: \u003ca href=\"https://www.newsletter.secretsatoshis.com/\" target=\"_blank\"\u003eSubscribe Now\u003c/a\u003e.]]\u003e\u003c/Text\u003e\u003c/Group\u003e\u003c/Group\u003e\u003cGroup label=\"Report Definitions / Glossary\" columns=\"1\" valign=\"top\"\u003e\u003cGroup columns=\"1\" valign=\"top\"\u003e\u003cText\u003e\u003c![CDATA[### Report Section Definitions]]\u003e\u003c/Text\u003e\u003cSelect type=\"tabs\"\u003e\u003cGroup label=\"Weekly Bitcoin Recap\" columns=\"1\" valign=\"top\"\u003e\u003cGroup columns=\"1\" valign=\"top\"\u003e\u003cText\u003e\u003c![CDATA[## Weekly Summary Table\n**Purpose:** Provides a comprehensive overview of the current Bitcoin market situation, focusing on key metrics.\n\n**Key Metrics:**\n- **Bitcoin Price USD:** The current market price of Bitcoin in US dollars.\n- **Bitcoin Marketcap:** The total market capitalization of Bitcoin.\n- **Sats Per Dollar:** The number of satoshis (smallest unit of Bitcoin) per US dollar.\n- **Bitcoin Dominance:** Bitcoin\u0027s market cap dominance compared to all other crypto assets.\n- **Bitcoin Miner Revenue (30-Day Daily Average):** The average daily revenue generated by Bitcoin miners over the past 30 days.\n- **Bitcoin Transaction Volume (30-Day Daily Average):** The average daily transaction volume on the Bitcoin network over the past 30 days.\n- **Bitcoin Market Sentiment:** The current market sentiment towards Bitcoin, as indicated by the Fear \u0026 Greed Index.\n- **Bitcoin Valuation:** The current valuation status of Bitcoin (Overvalued, Undervalued, Fair Value).\n\n**Insights:** This table provides a quick and comprehensive snapshot of Bitcoin\u0027s market status. It helps readers understand the asset\u0027s valuation, market dominance, and trading trends, which are critical for making informed investment decisions.\n\n## Open-High-Low-Close (OHLC) Chart\n**Purpose:** Presents an OHLC chart of Bitcoin prices, offering a detailed view of its price movements within specific time frames.\n\n**Insights:** Essential for technical analysis, providing insights into market sentiment and potential price directions. Helps in identifying patterns like bullish or bearish trends, breakouts, or reversals.]]\u003e\u003c/Text\u003e\u003c/Group\u003e\u003c/Group\u003e\u003cGroup label=\"Performance Tables\" columns=\"1\" valign=\"top\"\u003e\u003cGroup columns=\"1\" valign=\"top\"\u003e\u003cText\u003e\u003c![CDATA[## Equity Index Performance Table\n**Purpose:** Provides a comparative view of Bitcoin\u0027s performance against major stock indices like Nasdaq, and S\u0026P500.\n\n**Insights:** By comparing Bitcoin with major indices, this table offers an understanding of how Bitcoin performs in relation to traditional financial markets.\n\n## Sector ETF Performance Table\n**Purpose:** Analyzes the performance of Bitcoin alongside sector-specific ETFs such as technology, financials, energy, and real estate.\n\n**Insights:** This table highlights sector trends and correlations, helping to understand how different industries are performing relative to Bitcoin.\n\n## Macro Asset Performance Table\n**Purpose:** Evaluates Bitcoin\u0027s performance relative to macroeconomic indicators such as the US Dollar Index, Gold, Bonds, and the Commodity Index.\n\n**Insights:** This table provides a macroeconomic perspective on Bitcoin\u0027s performance within the global financial landscape.\n\n## Bitcoin-Related Stocks \u0026 ETFs Performance Table\n**Purpose:** Focuses on equities and ETFs directly related to Bitcoin and the cryptocurrency market, such as MicroStrategy (MSTR), Coinbase (COIN), and Bitcoin Miners ETF (WGMI).\n\n**Insights:** This table illustrates the performance of Bitcoin-related stocks, offering insights into investor sentiment and sector-specific movements.]]\u003e\u003c/Text\u003e\u003c/Group\u003e\u003c/Group\u003e\u003cGroup label=\"Monthly Heatmap\" columns=\"1\" valign=\"top\"\u003e\u003cGroup columns=\"1\" valign=\"top\"\u003e\u003cText\u003e\u003c![CDATA[## Monthly Heatmap of Returns\n**Purpose:** Presents monthly and yearly Bitcoin returns in a heatmap format, providing a quick visual overview of performance over time.\n\n**Insights:** Allows for easy identification of periods with high returns or significant losses. Can be used to spot seasonal patterns or annual trends in Bitcoin\u0027s market performance.]]\u003e\u003c/Text\u003e\u003c/Group\u003e\u003c/Group\u003e\u003c/Select\u003e\u003c/Group\u003e\u003c/Group\u003e\u003c/Select\u003e\u003c/View\u003e", "assets": {"b6ef1b2ac9": {"src": "data:application/vnd.plotly.v1+json;base64,IntcImRhdGFcIjpbe1wiY2xvc2VcIjpbMjM3NTEuMCwyMjkzNy44LDIxNzg2LjAsMjQyODcuMiwyMzU2NC41LDIyNDI2LjksMjIxNTcuNSwyODA0OS45LDI4MDAwLjAsMjgxODUuMCwyODMzMy43LDMwMzE2LjAsMjc1ODkuNywyOTI0My4xLDI4NDY4LjAsMjY5MjMuMCwyNjc1MC42LDI4MDkwLjAsMjcxMjIuOSwyNTkyOS4wLDI2MzM0LjcsMzA0NDcuMywzMDYyMi43LDMwMTc1LjEsMzAyMzk
